import React, { Component }  from 'react';

import { Link } from 'react-router-dom';





class Catalog extends Component{
  constructor(props) {
    super(props);

    this.state = {
      catalog: [["Front-end", ['React', ['First Article', 'Second Article']], 
                              ['Redux', ['First Article', 'Second Article']]]]
    };
  }

  render() {

    return(   
      <div className="catalog">
      <h2> Каталог </h2>
        { 
          this.state.catalog.map( global  =>
            <div key={global} className="catalog_global-level">
              <h3>{global[0]}</h3>
              { 
                global[1].map( first  =>
                  <div key={first} className="catalog_first-level">
                    <h3>{first[0]}</h3>

                  </div>
                )
              }
            </div>
          )
        }

      </div>
    );
  }
}

export default Catalog;
